  "title": {
    "nb": "Reindrift - Reinbeitedistrikt"
  },
  "description": {
    "nb": "Datasettet avgrenser reinbeitedistriktene i det samiske reinbeiteområdet. Retten til å utøve reindrift innenfor disse områdene er eksklusiv for den samiske befolkning. Denne samiske særretten gjelder ikke utenfor disse områdene, hvor det kreves særskilt tillatelse for å utøve reindrift på egne og leide arealer. Et reinbeitedistrikt utgjør en administrativ enhet for en eller flere siidaer. Fylkesmannen er forvaltningsmyndighet i reinbeitedistriktene."
  },
