  "title": {
    "nb": "Arealressurskart - AR50 - Dyrkbar jord"
  },
  "description": {
    "nb": "Kartlag i det landsdekkende datasettet AR50 som viser dyrkbar jord i målestokk 1:50 000. Dyrkbar jord er arealer som ved oppdyrking kan settes i stand slik at de vil holde kravene til fulldyrka jord og som holder kravene til klima og jordkvalitet for plantedyrking. \n\nKartlaget Dyrkbar jord i AR50 er fremstilt ved generalisering av datasettet Dyrkbar jord avledet fra Digitalt markslagskart og oppdatert med arealressursklasser fra Arealressurskart i målestokk 1:5.000 (AR5). OVer tregrensa er dyrkbar jord konstruert etter tolking av satellittbilder over tregrensa. I tillegg er det brukt topografisk Norgeskart i målestokk 1:50.000 (N50) der vi verken har hatt AR5 eller satellittbilder. \n\nDyrkbar jord kan være registrert på arealtypene overflatedyrka jord, innmarksbeite, skog, åpen fastmark og myr slik dette er kartlagt i datasettet Arealressurskart i målestokk 1:5000 (FKB-AR5). Figurer med dyrkar jord som er mindre enn 15 dekar, vises ikke på kartet, men blir slått sammen med tilgrensende områder.\n\nDatasettet oppdateres en gang hvert tredje år. Siste versjon har data fra 31.12.2016."
  },
