  "description": {
    "nb": "Helsenorge.no er den offentlige, innbyggerrettede helseportalen. Her finner du kvalitetssikret og oppdatert informasjon om helse, livsstil, sykdom, behandling og rettigheter. Innholdet er levert og kvalitetssikret av offentlige helseaktører og en del sykehus i Norge.Formålet med tjenesten er å gi den enkelte pasienten eller de pårørende et bedre og enklere møte med helsetjenesten, og hjelpe de med å øke mestringen, styrke pasientrollen og få en bedre helse. Portalen drives av Direktoratet for e-helse."
