  "description": {
    "nb": "Værkart fra Meteorologisk institutt. Tjenesten viser felt fra de til enhver tid beste modellene som MET produserer og tilbyr også observasjoner og noen avledede produkter. Prognosekartene består av data fra atmosfære-, hav- og bølgemodeller i ulike oppløsninger, med den beste oppløsningen tilgjengelig i nederste zoomnivåer. De fleste datasettene har timesoppløsning med en oppdateringsfrekvens på hver sjette time og gjelder for Norden 66 timer frem i tid."
  },
