  "title": {
    "nb": "Korallrev"
  },
  "description": {
    "nb": "Kartet viser dokumenterte og stedfestede korallrev av steinkorallen Lophelia pertusa.\nForekomstene av korallrev er angitt som punkter på kart. Disse utgjør verdifull informasjon som beslutningsgrunnlag ved vurdering av nye oppdrettskonsesjoner, utslipp i sjø, deponering, utbygging av petroleumsrelaterte installasjoner, og regulering av fiskeriaktivitet.\nDataene egner seg for fremstilling av temakart, oversiktskart, interaktive kart, kartløsninger på internett og til geografiske analyser. \nPå webkart anbefales det at Korallrev benyttes i målestokksområdet fra 1:500 \ntil 1:11000000. \nFor mer informasjon om korallrev se:\nhttp://www.mareano.no/tema/koraller/korallrev\nhttp://www.mareano.no/kart/mareano.html"
  },
