  },
  "description": {
    "nb": "Datasettet viser norske verneområder med status som Ramsarområder, under den internasjonale Ramsarkonvensjonen. Alle norske Ramsarområder er vernet som Naturvernområder (eget datasett). Noen ganger omfatter Ramsar-statusen kun deler av det aktuelle naturvernområdet. Et Ramsarområde kan også omfatte areal i flere ulike naturvernområder. Hensikten med dette datasettet er derfor å definere helt entydig hvilke areal som omfattes av Ramsarkonvensjonen i Norge. I tillegg inneholder det en områdebeskrivelse på norsk, som forklarer om historikk og begrunnelse for at områdene har fått en så viktig internasjonal status"
  },
