  "title": {
    "nb": "Arealressurskart - AR50 - Arealtyper"
  },
  "description": {
    "nb": "Kartlag i det landsdekkende datasettet AR50 som viser hovedtyper av arealessurser i målestokk 1:50 000 tilpasset bruk i målestokker fra 1:20 000 til 1:100 000. Arealtype er en inndeling i åtte arealressursklasser. Egenskap/kolonne i datasettet som skal brukes til å fremstille kartlaget heter ARTYPE. AR50 fremstilt ved en generalisering av AR5 under tregrensa, og tolking av satellittbilder over tregrensa. I tillegg har det vært benyttet N50 der vi verken har hatt AR5 eller satellittbilder. Figurer som er mindre enn 15 dekar vises ikke på kartet, men blir slått sammen med tilgrensende områder. Datasettet oppdateres en gang hvert tredje år med siste års versjon av FKB-AR5 (Arealressurskart i målestokk 1:5000 i databasen pr. 31.12). Siste oppdatering har data fra 31.12.2016. Data lastes ned som fylkesvise eller kommunevise filer."
  },
