  "title": {
    "nb": "IMDis spørreundersøkelse om kommunenes arbeid med integrering 2017/2018"
  },
  "description": {
    "nb": "IMDi gjennomfører rundt årsskiftet hvert år en undersøkelse om kommunenes arbeid med bosetting og integrering av flyktninger og innvandrere, og om kommunenes erfaringer med og oppfatninger av IMDi som samarbeidspartner. Undersøkelsen går til alle landets kommuner ved rådmannen, samt bydelsdirektør i Oslo. Undersøkelsen har blitt gjennomført siden 2014, og ble sist gjennomført ved årsskiftet 2017/2018.Dette datasettet inneholder svarene fra kommuner og bydeler i 2017/2018."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eIMDi gjennomfører rundt årsskiftet hvert år en undersøkelse om kommunenes arbeid med bosetting og integrering av flyktninger og innvandrere, og om kommunenes erfaringer med og oppfatninger av IMDi som samarbeidspartner. Undersøkelsen går til alle landets kommuner ved rådmannen, samt bydelsdirektør i Oslo. Undersøkelsen har blitt gjennomført siden 2014, og ble sist gjennomført ved årsskiftet 2017/2018.\u003c/p\u003e\u003cp\u003eDette datasettet inneholder svarene fra kommuner og bydeler i 2017/2018.\u003c/p\u003e"
  },
