  "title": {
    "nb": "Åpne vitenarkiv (Brage)"
  },
  "description": {
    "nb": "Brage-konsortiet består av ca 70 norske institusjoner innen høyre utdanning, forskning, helse og forvaltning. Hver institusjon har et åpent vitenarkiv som brukes for tilgjengeliggjøring av institusjonens forsknings- og studentarbeider. Det brukes også for å gi åpen tilgang til rapporter, serier, datasett, lydopptak, filmer og annet materiale som er produsert ved institusjonen.Metadataposter i norske vitenarkiv som inngår i Brage-konsortiet er tilgjengelig for nedlastning/høsting via protokollen OAI-PMH.På denne siden finner du høsteurl\u0027er for hvert enkelt arkiv. Innen hvert arkiv kan du høste alt eller deler av innholdet:https://www.unit.no/vitenarkiv-i-bragekonsortietIdentify - gir oversikt over metadata for arkivet, OAI-versjon, tidligste registrerte data o.l.List Sets - gir oversikt over tilgjengelige logiske delmengder som kan høstesList Metadata Formats - gir oversikt over tilgjengelige metadataformatList Identifiers - gir liste over identifikatorene til innholdetList Records - gir de enkelte metadataposteneEksempel 1:Spørring som gir metadataposter i vitenarkivet til NIBIO registrert etter 1. januar 2020 på Dublin Core format (oai_dc):https://nibio.brage.unit.no/nibio-oai/request?verb\u003dListRecords\u0026amp;metadataPrefix\u003doai_dc\u0026amp;from\u003d2020-01-01Eksempel 2:Spørring for å hente ut neste del av et resultat-settNår det gjøres en spørring hentes de 100 første postene. For å hente de neste 100 brukes Resumptiontoken for å gjøre neste spørring:https://nibio.brage.unit.no/nibio-oai/request?verb\u003dListRecords\u0026amp;resumptionToken\u003d[SETT_INN_RESUMPTIONTOKEN_HER]Eksempel på ResumptionToken: oai_dc/2019-01-01T00:00:00Z///100 Sist oppdatert 28/01 2020."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eBrage-konsortiet består av ca 70 norske institusjoner innen høyre utdanning, forskning, helse og forvaltning. Hver institusjon har et åpent vitenarkiv som brukes for tilgjengeliggjøring av institusjonens forsknings- og studentarbeider. Det brukes også for å gi åpen tilgang til rapporter, serier, datasett, lydopptak, filmer og annet materiale som er produsert ved institusjonen.\u003c/p\u003e\u003cp\u003eMetadataposter i norske vitenarkiv som inngår i Brage-konsortiet er tilgjengelig for nedlastning/høsting via protokollen OAI-PMH.\u003c/p\u003e\u003cp\u003ePå denne siden finner du høsteurl\u0027er for hvert enkelt arkiv. Innen hvert arkiv kan du høste alt eller deler av innholdet:\u003c/p\u003e\u003cp\u003ehttps://www.unit.no/vitenarkiv-i-bragekonsortiet\u003c/p\u003e\u003cul\u003e\u003cli\u003eIdentify - gir oversikt over metadata for arkivet, OAI-versjon, tidligste registrerte data o.l.\u003c/li\u003e\u003cli\u003eList Sets - gir oversikt over tilgjengelige logiske delmengder som kan høstes\u003c/li\u003e\u003cli\u003eList Metadata Formats - gir oversikt over tilgjengelige metadataformat\u003c/li\u003e\u003cli\u003eList Identifiers - gir liste over identifikatorene til innholdet\u003c/li\u003e\u003cli\u003eList Records - gir de enkelte metadatapostene\u003c/li\u003e\u003c/ul\u003e\u003cp\u003e\u003cstrong\u003eEksempel 1:\u003c/strong\u003e\u003cbr\u003eSpørring som gir metadataposter i vitenarkivet til NIBIO registrert etter 1. januar 2020 på Dublin Core format (oai_dc):\u003cbr\u003ehttps://nibio.brage.unit.no/nibio-oai/request?verb\u003dListRecords\u0026amp;metadataPrefix\u003doai_dc\u0026amp;from\u003d2020-01-01\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eEksempel 2:\u003c/strong\u003e\u003cbr\u003eSpørring for å hente ut neste del av et resultat-sett\u003cbr\u003eNår det gjøres en spørring hentes de 100 første postene. For å hente de neste 100 brukes Resumptiontoken for å gjøre neste spørring:\u003cbr\u003ehttps://nibio.brage.unit.no/nibio-oai/request?verb\u003dListRecords\u0026amp;resumptionToken\u003d[SETT_INN_RESUMPTIONTOKEN_HER]\u003cbr\u003eEksempel på ResumptionToken: oai_dc/2019-01-01T00:00:00Z///100\u003c/p\u003e\u003cp\u003e \u003c/p\u003e\u003cp\u003eSist oppdatert 28/01 2020.\u003c/p\u003e"
  },
