  },
  "description": {
    "nb": "Dette er datasett som viser leveranser av egg som er levert fra jordbruksforetak til eggpakkeri i landbruket. For det enkelte foretak vises organisasjonsnummer, navn, kommunenummer og kilo som er levert til eggpakkeri i løpet av kalenderåret. Dataene inkluderer ikke egg som er solgt direkte til produsent. Nytt datasett blir lagt ut årlig. Dette skjer vanligvis i mars, året etter at eggene er levert til eggpakkeri."
  },
