  "title": {
    "nb": "Data over hvilke kommuner regionale statlige virksomheter dekker "
  },
  "description": {
    "nb": "Datasett med den regionale inndelingen av statlige virksomheter og hvilke kommuner den regionale virksomheten dekker. Det er tenkt brukt sammen med datasettet over enhetene i offentlig forvaltning.EtatsbasenDette datasettet er en del av flere datasett om offentlige virksomheter. Datasettene blir omtalt som \"etatsbasen\" og lå tidligere på Norge.no. De inneholder en oversikt over offentlige virksomheter, det vil si statlige etater og virksomheters sentrale, regionale og lokale enheter, fylkeskommuner og kommuner. Datasettene blir ikke oppdatert.Datasettene inneholder informasjon om navnet til virksomheten, besøksadresse, postadresse, telefonnummer, e-post, nettadresse (URL), kartkoordinater (posisjon), dekning (hvilke kommuner virksomheten dekker), organisasjonsnummer, overordnet virksomhet, organisasjonstype, tilknytningsform (måten en virksomhet er knyttet til den utøvende statsmakt på) og kvalitetsvurderinger av nettsidene.Slå opp på emneord/tagg \"etatsbasen\" for å se de andre datasettene.Etatsbasen er nedlagt og blir ikke lenger vedlikeholdt av Difi. Datasettene ble sist oppdatert januar 2012. Merk at dette ikke betyr at alle data ble oppdatert i januar 2012, men at de siste endringene ble gjort da. Henvisning til kildenVed bruk av dette datasettet ber vi om at kilden blir henvist til på følgende måte (jf. NLOD-lisensen): Tjenesten er basert på åpne datasett fra Difi og er underlagt Norsk lisens for offentlige data (NLOD). Datagrunnlaget ble sist oppdatert i 2012 og blir ikke lenger vedlikeholdt av Difi."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eDatasett med den regionale inndelingen av statlige virksomheter og hvilke kommuner den regionale virksomheten dekker. Det er tenkt brukt sammen med datasettet over enhetene i offentlig forvaltning.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eEtatsbasen\u003c/strong\u003e\u003cbr\u003eDette datasettet er en del av flere datasett om offentlige virksomheter. Datasettene blir omtalt som \"etatsbasen\" og lå tidligere på Norge.no. De inneholder en oversikt over offentlige virksomheter, det vil si statlige etater og virksomheters sentrale, regionale og lokale enheter, fylkeskommuner og kommuner. Datasettene blir ikke oppdatert.\u003c/p\u003e\u003cp\u003eDatasettene inneholder informasjon om navnet til virksomheten, besøksadresse, postadresse, telefonnummer, e-post, nettadresse (URL), kartkoordinater (posisjon), dekning (hvilke kommuner virksomheten dekker), organisasjonsnummer, overordnet virksomhet, organisasjonstype, tilknytningsform (måten en virksomhet er knyttet til den utøvende statsmakt på) og kvalitetsvurderinger av nettsidene.\u003c/p\u003e\u003cp\u003eSlå opp på emneord/tagg \"etatsbasen\" for å se de andre datasettene.\u003c/p\u003e\u003cp\u003eEtatsbasen er nedlagt og blir ikke lenger vedlikeholdt av Difi. Datasettene ble sist oppdatert januar 2012. Merk at dette ikke betyr at alle data ble oppdatert i januar 2012, men at de siste endringene ble gjort da. \u003c/p\u003e\u003cp\u003e\u003cstrong\u003eHenvisning til kilden\u003c/strong\u003e\u003cbr\u003eVed bruk av dette datasettet ber vi om at kilden blir henvist til på følgende måte (jf. NLOD-lisensen):\u003cbr\u003e \u003cbr\u003eTjenesten er basert på åpne datasett fra Difi og er underlagt Norsk lisens for offentlige data (NLOD). Datagrunnlaget ble sist oppdatert i 2012 og blir ikke lenger vedlikeholdt av Difi.\u003c/p\u003e"
  },
